// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./OutcomeToken.sol";

contract PredictionMarket {
    // --- Events ---
    event Bet(
        address indexed user,
        Outcome indexed outcome,
        uint256 usdcAmount,
        uint256 payoutTokens
    );
    event Resolved(Outcome winningOutcome);
    event Redeemed(address indexed user, uint256 usdcPayout);

    // --- State ---
    enum Outcome {
        Unresolved,
        Yes,
        No
    }

    IERC20 public immutable usdcToken;
    OutcomeToken public immutable yesToken;
    OutcomeToken public immutable noToken;

    // The constant product (x * y = K), scaled by 10**36
    // Calculated from initial liquidity: (500e18 * 500e18) = 250000e36
    uint256 public immutable K;

    // AMM pool balances
    uint256 public poolYes;
    uint256 public poolNo;

    // Total USDC collateral backing the outcome tokens
    uint256 public totalCollateral;

    // Market resolution state
    Outcome public winningOutcome;
    address public immutable oracle;

    // Conversion factor between 6-decimal USDC and 18-decimal outcome tokens
    uint256 private constant DECIMALS_CONVERSION_FACTOR = 10 ** 12;

    // --- Constructor ---
    constructor(address _usdcAddress, uint256 _initialUSDC) {
        oracle = msg.sender;
        usdcToken = IERC20(_usdcAddress);

        // Deploy outcome tokens and set this contract as their owner
        yesToken = new OutcomeToken("Yes Token", "YES", address(this));
        noToken = new OutcomeToken("No Token", "NO", address(this));

        // Pull initial liquidity from deployer
        usdcToken.transferFrom(msg.sender, address(this), _initialUSDC);
        totalCollateral = _initialUSDC;

        uint256 initialTokens = _initialUSDC * DECIMALS_CONVERSION_FACTOR;

        // Initialize pools
        poolYes = initialTokens;
        poolNo = initialTokens;

        // Mint initial tokens to the contract's pools
        yesToken.mint(address(this), poolYes);
        noToken.mint(address(this), poolNo);

        // Set the constant product K
        K = poolYes * poolNo;
    }

    // --- Betting Functions ---

    /**
     * @notice Place a bet on the "Yes" outcome.
     * @param usdcAmount The amount of USDC to bet.
     */
    function betYes(uint256 usdcAmount) external {
        require(usdcAmount > 0, "Amount must be positive");
        require(winningOutcome == Outcome.Unresolved, "Market is resolved");

        // 1. Transfer collateral from user
        usdcToken.transferFrom(msg.sender, address(this), usdcAmount);
        totalCollateral += usdcAmount;

        uint256 tokenAmount = usdcAmount * DECIMALS_CONVERSION_FACTOR;

        // 2. Mint new collateralized tokens
        yesToken.mint(msg.sender, tokenAmount); // Mint Yes tokens to user
        noToken.mint(address(this), tokenAmount); // Mint No tokens to the AMM pool

        // 3. Perform the swap in the AMM
        uint256 oldPoolYes = poolYes;
        poolNo += tokenAmount;
        poolYes = K / poolNo; // K is scaled, so result is scaled

        // 4. Calculate Yes tokens to send to user from the pool
        uint256 yesTokensOut = oldPoolYes - poolYes;

        // 5. Transfer swapped tokens to user
        yesToken.transfer(msg.sender, yesTokensOut);

        emit Bet(
            msg.sender,
            Outcome.Yes,
            usdcAmount,
            tokenAmount + yesTokensOut
        );
    }

    /**
     * @notice Place a bet on the "No" outcome.
     * @param usdcAmount The amount of USDC to bet.
     */
    function betNo(uint256 usdcAmount) external {
        require(usdcAmount > 0, "Amount must be positive");
        require(winningOutcome == Outcome.Unresolved, "Market is resolved");

        usdcToken.transferFrom(msg.sender, address(this), usdcAmount);
        totalCollateral += usdcAmount;

        uint256 tokenAmount = usdcAmount * DECIMALS_CONVERSION_FACTOR;

        noToken.mint(msg.sender, tokenAmount);
        yesToken.mint(address(this), tokenAmount);

        uint256 oldPoolNo = poolNo;
        poolYes += tokenAmount;
        poolNo = K / poolYes;

        uint256 noTokensOut = oldPoolNo - poolNo;
        noToken.transfer(msg.sender, noTokensOut);

        emit Bet(msg.sender, Outcome.No, usdcAmount, tokenAmount + noTokensOut);
    }

    // --- Redemption & Resolution ---

    /**
     * @notice Resolves the market, callable only by the oracle.
     * @param _winningOutcome The outcome of the event (Yes or No).
     */
    function resolve(Outcome _winningOutcome) external {
        require(msg.sender == oracle, "Only oracle can resolve");
        require(
            winningOutcome == Outcome.Unresolved,
            "Market already resolved"
        );
        require(
            _winningOutcome != Outcome.Unresolved,
            "Cannot resolve to Unresolved"
        );
        winningOutcome = _winningOutcome;
        emit Resolved(_winningOutcome);
    }

    /**
     * @notice Redeem winning tokens for USDC collateral.
     * User must first approve this contract to spend their winning tokens.
     */
    function redeem() external {
        require(winningOutcome != Outcome.Unresolved, "Market not resolved");

        OutcomeToken winningToken = (winningOutcome == Outcome.Yes)
            ? yesToken
            : noToken;
        uint256 userBalance = winningToken.balanceOf(msg.sender);

        if (userBalance > 0) {
            // Each 1e18 of winning token is redeemable for 1 USDC (1e6)
            uint256 usdcPayout = userBalance / DECIMALS_CONVERSION_FACTOR;

            // Burn user's tokens and send USDC
            winningToken.burnFrom(msg.sender, userBalance);
            usdcToken.transfer(msg.sender, usdcPayout);

            emit Redeemed(msg.sender, usdcPayout);
        }
    }

    // --- View Functions ---

    /**
     * @notice Gets the current price of a "Yes" outcome share.
     * @return price The price, scaled by 1e18.
     */
    function getYesPrice() external view returns (uint256) {
        if (poolYes + poolNo == 0) return 0;
        return (poolNo * 1e18) / (poolYes + poolNo);
    }
}

